import Nav from "../Nav/Nav";
import "./Header.css";

function Header(): JSX.Element {
    return (
        <div className="Header">
            <h1>בדיקת טלפון במאגר ״אל תתקשר אליי״</h1>
        <Nav/>
         </div>
    );
}

export default Header;
